pragma solidity >=0.4.21 <0.6.0;
import "./Token.sol";

contract TokenMarketplace{
    address public admin;
    uint256 public tokenPrice;
    Token public token;

    struct TokenMarket{
        uint id;
        address owner;
        uint price;
        uint256 tokens;
        bool purchased;
    }

    event BalanceDollar(
        address _address,
        uint dollar
    );

    event TokenOrdered(
        uint id,
        uint price,
        address owner,
        bool purchased
    );

    event TokenPurchased(
        uint id,
        uint price,
        address owner,
        bool purchased
    );
    //TODO : all the function
    
    mapping(address => uint256) public dollars;
    mapping(uint => TokenMarket) public offers;
    uint256 public dollarsIndex;

    constructor(Token _token,uint256 _price) public{
        admin = msg.sender;
        token = _token;
        tokenPrice = _price;
    }   

    function depositDollars(uint256 _value) public returns(bool success){
        dollars[msg.sender] += _value;
        return true;
    }

    function transferDollars(address _from,address _to,uint256 _value) public returns(bool success){
        require(dollars[_from] >= _value,"not enough money");

        dollars[_from] -= _value;
        dollars[_to] += _value;

        return true;
    }

    function getDollars(address _address) public returns(uint256 gotDollars){
        emit BalanceDollar(_address,dollars[_address]);
        return dollars[_address];
    }

    function sell(uint nTokens, uint _price) public returns(bool success){
        require(token.getBalance(msg.sender) >= nTokens,"Seller not have enough tokens;");

        offers[dollarsIndex] = TokenMarket(dollarsIndex,msg.sender,_price,nTokens,false);
    
        //event
        emit TokenOrdered(dollarsIndex,_price,msg.sender,false);
        dollarsIndex++;
        return true;
    }

    function buy(uint _id) public returns(bool success){
        TokenMarket memory offer = offers[_id];

        require(dollars[msg.sender] >= offer.tokens * tokenPrice,"Buyer not have enough moneys;");
        require(token.transfer(offer.owner,msg.sender,offer.tokens),"Error");
        require(transferDollars(offer.owner, msg.sender, offer.tokens * tokenPrice),"Error");

        offer.purchased = true;

        //event
        emit TokenPurchased(_id,offer.tokens * tokenPrice,msg.sender,true);

        return true;
    }
}
